('JOB001286', '2060 ตลาดภูดอย เชียงใหม่ UPS ไม่สำรองไฟมานานแล้ว Alarm Battery', '-ทดสอบ self test พบอลาร์มแบตเตอรี่ คาดว่าแบตน่าจะเสื่อม \\n-Load on ups\\nคุณณัฐณิชา 0956385104', 'On-hold', '', '', '', 'CM', '2018-07-03'),
('JOB001287', '2839 ดอกคำใต้ พะเยา เครื่องมีควันขึ้นและมีกลิ่นไหม้', 'ทางสาขาแจ้งเครื่องมีควันขึ้นและมีกลิ่นไหม้ไม่ทราบสาเหตุ\\n-off ups และ on bypass\\nคุณอดิศร manager 062 605 5749', 'Created', '', '', '', 'CM', '2018-07-03'),
('JOB001288', '1368 เลียบคลองสี่วา สมุทรสาคร เครื่องมีเสียงร้อง UPS ไม่จ่ายไฟ', 'ไม่ทราบสาเหตุคาดว่าน่าจะเกิดจากมีคนนำอุปกรณ์อื่นมาเสียบที่ปลั๊กแดง\\n-power reset ups normal\\nคุณ วุฒิชัย FM 091 805 4901', 'Completed', '', '', '', 'CM', '2018-07-03'),
