('JOB001300', '5065 บางปู สมุทรปราการ แจ้งว่ามีอุปกรณ์ช็อตทำให้ ups ไม่มีไฟออก', '\"สาขา off cb ที่ช็อตไว้แล้ว\\n-ดู log ups alarm \"\"\"\"bypass over current\"\"\"\"\\n-Clear fault ; on inverter ใช้งานได้ตามปกติ\\nK\'วิรุฒ FM 0967163894\"\"\"\"\"', 'Completed', '', '', '', 'CM', '2018-07-04'),
('JOB001302', '2172 ม่วงงาม สงขลา  UPS ไม่สำรองไฟ Battery เสื่อมสภาพ', 'ทางสาขาแจ้งว่า่เครื่องไม่สำรองไฟ มีไฟดับเครื่องposดับทันที ตรวจเช็คเครื่อง onปกติ \\nสาเหตุน่าจะเกิดจากbattery เสื่อมสภาพ \\nสาขาไม่สะดวกtest battery \\nKอรพรรณ Esm 091-045-9553', 'Created', '', '', '', 'BATT', '2018-07-04'),
('JOB001303', '6575 เวียงสา น่าน UPS Alarm fault output short', 'ทำการ on ups ใช้งานได้ตามปกติ\\n-พบ cb main o/p trip - off ลูกย่อยทั้งหมด on cb main ขึ้นก่อนแล้วจึงค่อยๆ on ลูกย่อยขึ้นทีละตัว\\n-ups normal\\nคุณนงค์ ASM 0872019911', 'Completed', '', '', '', 'CM', '2018-07-04'),
('JOB001304', '5075 ศรีษะเกศ อุปกรณ์ดับหมด ups มีเสียงร้อง log alarm output shorted', 'อยู่ดีๆ อุปกรณ์ดับหมด\\n-ups มีเสียงร้องดัง ดูจาก log มี alarm output shorted เวลา 2312 น EPO เวลา 0633 น\\n-power reset - ups normal\\n-แจ้งการใช้งานของปุ่ม EPO กับทางเจ้าหน้าที่ FM เพื่อประสานงานกันในสาขาอีกครั้ง\\nKhun มงคล FM 0816595808', 'Completed', '', '', '', 'CM', '2018-07-05'),
('JOB001305', '2851 เอสโซ่บ้านโพธิ์ ฉะเชิงเทรา Load ดับ UPS ดับ /bypass', '-ทางสาขาแจ้งว่าอยู่ดีๆโหลดดับ ups ดับ\\n- ให้ ลูกค้า on bypass ใช้งานก่อน เนื่องจากมีลูกค้า \\n-ลองทดสอบ on CB input ประมาณ10วินาที CB input และ CB main input trip\\nคาดว่าเครื่องน่าจะ short เสีย ให้ลูกค้าใช้งานbypass\\nคุณภัทรวดี manager 0635249416', 'Created', '', '', '', 'CM', '2018-07-05'),
