('JOB001311', '2184 โนนหัน ขอนแก่น ups ดับไม่สำรองไฟฟ้า ups alarm battery', '-ups ดับไม่สำรองไฟฟ้า\\n-on ups test พบ ups alarm battery \\n-on bypass ใช้งาน\\nK\'ภัทรพล SL 0626058316', 'Created', '', '', '', 'CM', '2018-07-05'),
