('JOB001314', '2758 โคกสูงสัมพันธ์ ขอนแก่น breaker box bypass off / alarm battery', '-ลูกค้าแจ้งไฟตก พอไฟมาแคชเชียร์ดับ\\n-ตรวจสอบ เบรกเกอร์ในbox bypass off ทุกตัว ลอง on CB input พบเครื่องมีอลาร์มแบตเตอรี่\\n power reset ไม่หายจึงสรุปได้ว่าสาขานี้เครื่องน่าจะเสียนานแล้วและใช้ไฟ bypass อยู่\\n-on bypass ใช้งาน\\nคุณ สุกัญญา SL 0626058854', 'On-hold', '', '', '', 'CM', '2018-07-06'),
